  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Chartbooks for 2001 and 2002 contain
  37 tables, charts, and graphs that present highlights from the Statistical Compendiums,
  including comparisons of use and reimbursement for major eligibility groups (aged,
  disabled, adults, children, dual eligibles) and types of drugs, and state rankings
  on key measures.  The 2003 through 2008 Chartbooks contain 54 tables, charts, and
  graphs, since a number of additional graphs have been added to show trends from
  1999 to 2008.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
